import React from "react";
import ButtonLogoAnel from "../buttons/anel";
import ButtonTrird from "../buttons/button3";
import { Button, ButtonContainer, HeaderContainer } from "./styles";

// https://youtu.be/AXKc4WhgLSA - criar header com typeScript

const Header: React.FC = () => {
  

  return (
<HeaderContainer>
  <Button>     
  <ButtonTrird>**AGENDA ANIVERSARIANTES **</ButtonTrird>
  
  < ButtonLogoAnel />  
  </Button>
    <ButtonContainer>  
    <ButtonTrird>TOP 10</ButtonTrird>
    <ButtonTrird>CONSULTA MÊS</ButtonTrird>
    <ButtonTrird>ADD ANIVERSARIANTES</ButtonTrird>

  </ButtonContainer>  
    </HeaderContainer>
  )
}

export default Header
//<button onClick={handleClick}>Consulta por mês</button></Button>
